  const TOEXPORT_FOLDER_ID = '175c45d5f9ec4f3f2fa9e3099c39e153';  // ToExport folder
  const DOWNLOAD_DELAY_MS = 1500;  // Delay between files to avoid Chrome blocking
  const EXPORT_TRANSCRIPT = true;  // Set to false to skip transcripts
  const EXPORT_SUMMARY = true;     // Set to false to skip summaries
  // ========================================

  console.log('üìã Fetching file list...');

  // Fetch all files
  const listRes = await fetch('https://api.plaud.ai/file/simple/web?skip=0&limit=500&is_trash=0&sort_by=start_time&is_desc=true', {
    headers: { 'Authorization': token }
  });
  const listData = await listRes.json();
  if (listData.status !== 0) { alert('Failed to fetch file list'); return; }

  const files = listData.data_file_list || [];
  console.log(`Found ${files.length} files total`);

  // Group files
  const unfiled = files.filter(f => !f.filetag_id_list || f.filetag_id_list.length === 0);
  const filed = files.filter(f => f.filetag_id_list && f.filetag_id_list.length > 0);

  // Build folder map from filed files
  const folderMap = {};
  for (const f of filed) {
    for (const tagId of (f.filetag_id_list || [])) {
      if (!folderMap[tagId]) folderMap[tagId] = [];
